Count 3 - Possess THC (2nd+offense) - Guilty plea.  Convicted.  State moves to dismiss and read in count 1, possess amphetamine and count 2, possess drug paraphernalia.  Motion granted.  Sentence is withheld.  Defendant is placed on probation to DOC for two (2) years.   Conditions of probation are:
1) Sixty (60) days jail, imposed and stayed, to be imposed upon the agent's discretion.  Should it be imposed, transfer to Marinette County is authorized.  
2) AODA assessment and follow through counseling;
3) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
4) Maintain absolute sobriety;
5) Submit to random urine screens and pay for same;
6) Provide DNA sample;
7) Pay $250.00 fine, plus costs, total of $1,079.25;
8) Pay supervision fees in an amount to be determined by DOC.
